            {props.ifFriends ? <Friends></Friends> : <Leagues></Leagues>}

            </div>
        </div>
        <div id = "profileEnd">
            <UserSettingsButton></UserSettingsButton>
            {props.ifFriends ? <SuggestedFriends></SuggestedFriends> : <SuggestedLeagues></SuggestedLeagues>}
        </div>
    </div>)*/
    return (<div>SocialPage</div>)
}
